import React from "react";
import home from "./Home.module.css"

const Home = () => {
    const list = () => {
        return(
            <ul className={home.list}>
                <a className={home.item}>Viktor</a>
            </ul>
        )
    }
    return (
        <div className={home.home}>
            {list}
        </div>
    )
}

export default Home
